function find_maximum_height(cuboids) {
    for (let cuboid of cuboids) {
        cuboid.sort((a, b) => (a - b));
    }
    cuboids.sort((ar, br) => {
        for (let i = 0; i < ar.length; i++) {
            if (ar[i] !== br[i]) {
                return ar[i] - br[i];
            }
            return 0;
